// SPDX-License-Identifier: MIT
pragma solidity ^0.6.12;

import "../openzeppelin/contracts/math/SafeMath.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import "../interface/IFund.sol";

contract Fund is Ownable, IFund {
    using SafeMath for uint256;
    address public tokenAddr;
    uint256 public totalAmount;
    uint256 public totalSupply;
    struct UserFundInfo {
        uint256 lpAmount;       // 用户当前拥有的lptoken数量
        uint256 tokenAmountIn;  // 用户累计充值的token数量
        uint256 tokenAmountOut; // 用户累计提现的token数量
    }

    mapping(address => UserFundInfo) public allUserFund;

    function initialize(address _tokenAddr) public onlyOwner {
        tokenAddr = _tokenAddr;
        totalAmount = 0;
        totalSupply = 0;
    }

    function deposit(
        address _userAddr,
        uint256 _tokenAmount
    ) public override onlyOwner returns (uint256 lpAmount) {
        if (totalSupply == 0) {
            lpAmount = _tokenAmount;
        } else {
            if (totalAmount == 0) {
                lpAmount = _tokenAmount;
            } else {
                lpAmount = _tokenAmount.mul(totalSupply).div(totalAmount); //池子的余额需要再加上头寸的浮动盈亏
            }
        }
        totalAmount = totalAmount.add(_tokenAmount);
        totalSupply = totalSupply.add(lpAmount);
        UserFundInfo storage userFundInfo = allUserFund[_userAddr];
        userFundInfo.lpAmount = userFundInfo.lpAmount.add(lpAmount);
        userFundInfo.tokenAmountIn = userFundInfo.tokenAmountIn.add(_tokenAmount);
    }

    function withdraw(
        address _userAddr,
        uint256 _lpAmount
    ) public override onlyOwner returns (uint256 tokenAmount) {
        UserFundInfo storage userFundInfo = allUserFund[_userAddr];
        userFundInfo.lpAmount = userFundInfo.lpAmount.sub(_lpAmount);
        tokenAmount = _lpAmount.mul(totalAmount).div(totalSupply); //池子的余额需要再加上头寸的浮动盈亏
        totalAmount = totalAmount.sub(tokenAmount);
        totalSupply = totalSupply.sub(_lpAmount);
        userFundInfo.tokenAmountOut = userFundInfo.tokenAmountOut.add(tokenAmount);
    }

    function tradePL(
        address _userAddr,
        uint256 _tradeAmount,
        uint256 _plFlag,
        uint256 _plAmount
    ) public override onlyOwner {}
}
